import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import Navigation from "./Navigation";
import style from "../css/servicepage.css";

class ServicePage extends React.Component {
  state = {
    contactName: "",
    phoneNumber: "",
    startLocation: "",
    endLocation: "",
    weight: 0,
    dryVan: true
  };

  render() {
    return (
      <section style={{ backgroundColor: "red", height: "100%" }}>
        <Navigation />
        <div style={{ height: "78px" }} />
        <div className="survey">
          <form action="https://formspree.io/tryc_khov@yahoo.com" method="POST">
            <h2> Name </h2>
            <input className="input-box" type="text" name="Name"/ >
            <h2> Phone Number </h2>
            <input className="input-box" type="text" name="Phone Number" />
            <h2> Email </h2>
            <input className="input-box" type="email" name="Email"/>
            <h2> Starting Location </h2>
            <input className="input-box" type="text" name="From"/>
            <h2> Destination </h2>
            <input className="input-box" type="text" name="To"/>
            <h2> Weight of Load </h2>
            <input className="input-box" type="text" name="Weight"/>
            <h2> Dry Van? </h2>
            <input className="input-box" type="text" name="Dry Van"/>
            <h2> Price </h2>
            <input className="input-box" type="text" name="Price"/>
            <input className="input-box" type="submit" value="Send" />
          </form>
        </div>
      </section>
    );
  }
}

export default ServicePage;
